function sampev.onSendCommand(cmd)
    local _, playerID = sampGetPlayerIdByCharHandle(playerPed)
    local playercolor = sampGetPlayerColor(playerID)
    if cmd == "/swmenu" then
        if playercolor ~= 2852192255 then 
            sampAddChatMessage(tag2 .. "You are not playing as SWAT", cfg.main.errormsg)
            return(false)
        else
        menu[0] = not menu[0]
        end
        return false
